import numpy as np
import pandas as pd
import sys
import time
from sklearn.metrics import mean_squared_error 
start_time=time.time()
input_path = sys.argv[1]
train_file=sys.argv[2]
test_file=sys.argv[3]
output_path=sys.argv[4]
train=pd.read_csv(train_file,encoding='utf-8')
users = list(set(train.ix[:,0]))
items = list(set(train.ix[:,1]))

ratings = [[0]*(len(items)) for user in users]

movie_index={}
users_index={}
count_user=0
count_movie=0
sum_rating=0
for index,row in train.iterrows():
    if row[0] not in users_index:
        users_index[row[0]]=count_user
        count_user+=1
    if row[1] not in movie_index:
        movie_index[row[1]]=count_movie
        count_movie+=1
    ratings[users_index[row[0]]][movie_index[row[1]]] = row[2]
    sum_rating+=row[2]
    
global_rating=sum_rating/len(train)
print(global_rating)  
def prediction(P,Q):
    return np.dot(P.T,Q)
    
def user_rating(user_id):
    rating_user = 0
    len_movie = 0
    for i in ratings[user_id]:
        
        if i != 0:
            
            rating_user += i
            len_movie += 1
    return rating_user/len_movie
    
def movie_rating(movie_id):
    print(movie_id)
    rating_user = 0
    len_movie = 0
    for i in ratings[:][movie_id]:
        
        if i != 0:
            
            rating_user += i
            len_movie += 1
    return rating_user/len_movie
   
   
print(time.time()-start_time)    
lmbda = 0.02
lmbda_1=0.02 
k = 8
m, n = len(ratings),len(ratings[0]) 
n_epochs = 35
alpha=0.002

P = np.random.rand(k,m)

bias_user=np.random.normal(0, 0.5 ,m)

Q = np.random.rand(k,n)
bias_item=np.random.normal(0, 0.5 ,n)
           


for epoch in range(n_epochs):
    for i in range(len(ratings)): #user
        for j in range(len(ratings[0])):#item
            if ratings[i][j]>0:
              
                e = ratings[i][j] - prediction(P[:,i],Q[:,j])  
                
                P[:,i] += alpha * ( e * Q[:,j] - lmbda * P[:,i]) 
                Q[:,j] += alpha * ( e * P[:,i] - lmbda * Q[:,j])  
                bias_user[i]+=alpha*(e-lmbda_1*(bias_user[i]))
                bias_item[j]+=alpha*(e-lmbda_1*(bias_item[j]))
    
    
        
print(time.time()-start_time)   

data1=pd.read_csv(test_file,encoding='utf-8')

final_result=[]
for index,row in data1.iterrows():

    user_id =users_index[row[0]]
    user_bias=user_rating(user_id)
    if row[1] not in movie_index:
        #value=global_rating#+np.mean(ratings[:][user_id])
   
        final_result.append(user_rating(user_id))
       
    else:
    
        movie=movie_index[row[1]]
        print(row[1])
        movie_bias=movie_rating(movie)
        value =np.dot(P[:,user_id], Q[:,movie])
        #print(user_id,bias_user[user_id]-global_rating)
        value+=user_bias+movie_bias-global_rating
        if value>5.0:
            value=5.0
        if value<0.5:
            value=0.5
        final_result.append(value)
    
    
import json
with open(output_path, 'w') as file:
    json.dump(final_result, file) 
    
